import React from "react";
// import SelectedNote from "./SelectedNote";

import "./Sidebar.css";

const Sidebar = (props) => {
  const noteSelectionHandler = (note) => {
    console.log("you clicked this note:", note);
  };

  return (
    <aside className="sidebar">
      <button type="button" className="button block tertiary header-text">
        Create Note
      </button>
      <ul>
        {props.notes.map((existingNotes) => (
          <li
            className="active"
            key={existingNotes.header}
          >
            <h3 className="header-text no-margin">{existingNotes.header}</h3>
            <p className="body-text no-margin muted">
              {existingNotes.timestamp}
            </p>
          </li>
        ))}
      </ul>
    </aside>
  );
};

export default Sidebar;
